  console.log("Counter stateLose:", stateLose);
  return (

    <form>
    <ObjectName/>
      {stateWin}
      <button formAction={formAction}>statewinIncrement</button>
      {stateLose}
      <button formAction={formAction2}>stateloseDecrement</button>
       <button formAction={formAction3}>reset</button>
    </form>
  )
}
